import 'package:json_annotation/json_annotation.dart'; part 'login.g.dart'; @JsonSerializable(nullable: false, ignoreUnannotated: false)class Login {  @JsonKey(name: 'message')  String message;  @JsonKey(name: 'home_page')  String homePage;  @JsonKey(name: 'full_name')  String fullName;  Login({required this.message, required this.homePage, required this.fullName});   factory Login.fromJson(Map<String, dynamic> json) => _$LoginFromJson(json);   Map<String, dynamic> toJson() => _$LoginToJson(this);}